todoApp.service("TodoService",function(e,t){return{getTodos:function(){var o=t.defer();return e.get("/todo/getTodos").success(function(e){o.resolve(e)}).error(function(e){o.reject(e)}),o.promise},addTodo:function(o){var s=t.defer();return e.post("/todo/addTodo",o).success(function(e){s.resolve(e)}).error(function(e){s.reject(e)}),s.promise},removeTodo:function(o){var s=t.defer();return e.post("/todo/removeTodo",o).success(function(e){s.resolve(e)}).error(function(e){s.reject(e)}),s.promise}}});